import React from "react";
import axios from "axios";

const ViewPost = ({ post }) => {
  console.log(post);
  return <div></div>;
};

export default ViewPost;

ViewPost.getInitialProps = async ({ query: { postid } }) => {
  const post = await fetch(`http://localhost:3000/api/posts/${postid}`)
    .then((res) => {
      console.log(res);
    })
    .catch((err) => {
      console.log(err);
    });

  return { post: "test" };
};
